                  {time: 'Aug', followers: 300},
                  {time: 'Sep', followers: 200},
                  {time: 'Oct', followers: 400},
                  {time: 'Nov', followers: 100},
                  {time: 'Dev', followers: 200},
            ],
            newMentions: [
                   {time: 'Jun', followers: 100},
                   {time: 'Jul', followers: 200},
                   {time: 'Aug', followers: 300},
                   {time: 'Sep', followers: 200},
                   {time: 'Oct', followers: 400},
                   {time: 'Nov', followers: 100},
                   {time: 'Dev', followers: 200},
             ],
      }
    };
  }

  componentDidMount = () => {
    this.getData();
  }

  getData = () => {

  }

  render() {

    const { data } = this.state;
    return (
      <div className="AA-container">
        <SummaryCard summary={data.summary}/>
        <BarGraphCard graphData={data.newFollowers}/>
        <PieGraphCard />
        <BarGraphCard graphData={data.newComments}/>
        <BarGraphCard graphData={data.newLikes}/>
        <BarGraphCard graphData={data.newMentions}/>
      </div>

    )
  }
}


export default AccountAnalytics;
